import React from 'react'

import HeroSection from './component/HeroSection'

import OurMissionSection from './components/OurMissionSection'
import TestimonialSection from './components/TestimonialSection'





function Home() {

  return (
    <div>
      <HeroSection/>
      <OurMissionSection/>
        <TestimonialSection/>
    </div>
  );

}


export default Home
